import React, { useEffect, useState, useRef } from 'react';
import { useNavigate } from 'react-router-dom';

const Dashboard = () => {
  const [userEmail, setUserEmail] = useState('');
  const [commissionData, setCommissionData] = useState([]);
  const [arSvData, setArSvData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const arSvIndexMapRef = useRef({});
  const navigate = useNavigate();

  // Your script's web app URL - ensure this is your latest deployment URL
  const scriptUrl = 'https://script.google.com/macros/s/AKfycbxB0H4zyCuczJXSzjvFnRiewLdiETw33mYMgEZabJuo9iGAn-31g1l-qw4S5K0C6u4X/exec';

  useEffect(() => {
    const storedEmail = localStorage.getItem('userEmail');
    if (storedEmail) {
      setUserEmail(storedEmail.trim());
    } else {
      navigate('/login');
    }
  }, [navigate]);

  useEffect(() => {
    if (userEmail) {
      setIsLoading(true);
      const fetchCommission = fetch(`${scriptUrl}?type=commission&email=${encodeURIComponent(userEmail)}`)
        .then((res) => res.json())
        .then((data) => {
          if (data.error) throw new Error(data.error);
          setCommissionData(data);
        })
        .catch(error => console.error('Error fetching commission data:', error));

      const fetchArSv = fetch(`${scriptUrl}?type=arsv&email=${encodeURIComponent(userEmail)}`)
        .then((res) => res.json())
        .then((data) => {
          if (data.error) throw new Error(data.error);
          
          // Improved logic to handle empty or invalid data
          if (!Array.isArray(data) || data.length === 0) {
            setArSvData([]);
            return;
          }
          
          const [headers, ...rows] = data;
          const indexMap = headers.reduce((acc, key, i) => {
            acc[key.toLowerCase().trim()] = i;
            return acc;
          }, {});
          arSvIndexMapRef.current = indexMap;
          setArSvData(rows);
        })
        .catch(error => console.error('Error fetching AR/SV data:', error));

      // Wait for both fetches to complete before setting loading to false
      Promise.all([fetchCommission, fetchArSv]).finally(() => setIsLoading(false));
    }
  }, [userEmail, scriptUrl]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    setUserEmail('');
    navigate('/login');
  };

  if (isLoading && userEmail) {
      return <div style={{ padding: '2rem' }}><h2>Loading Dashboard...</h2></div>;
  }
  
  if (!userEmail) {
    return <div style={{ padding: '2rem' }}><h2>Redirecting to login...</h2></div>;
  }

  return (
    <div style={{ padding: '2rem' }}>
      <h2>Welcome, {userEmail}</h2>
      <button onClick={handleLogout}>Logout</button>

      <h3>Your Weekly Commission</h3>
      {commissionData.length > 0 ? (
        <ul>
          {commissionData.map((entry, index) => (
            <li key={index}>
              <strong>Week:</strong> {entry.commissionweek} | <strong>Region:</strong> {entry.region} <br />
              <strong>New Business:</strong> {entry.newbusiness} | <strong>Rewrite:</strong> {entry.rewrite} | <strong>Total NBs:</strong> {entry.totalnbs} <br />
              <strong>Gross Pay:</strong> ${entry.grosspay} | <strong>Bonus Tier:</strong> {entry.bonustier} | <strong>Total Bonus:</strong> ${entry.totalbonus}
            </li>
          ))}
        </ul>
      ) : (
        <p>No commission data found for this period.</p>
      )}

      <h3>Your Scanning Violations & ARs</h3>
      {arSvData.length > 0 ? (
        <ul>
          {arSvData.map((row, index) => {
            const map = arSvIndexMapRef.current;
            const isAR = row[map['arfeeamount']];
            const isSV = row[map['svfeeamount']];

            // Don't render a list item if there's no data in the row
            if (!isAR && !isSV) return null;

            return (
              <li key={index}>
                <strong>Week:</strong> {row[map['week']]}<br />
                {isAR && (
                  <>
                    <strong>Type:</strong> AR | <strong>Customer:</strong> {row[map['arcustomername']]} | <strong>Amount:</strong> ${row[map['arfeeamount']]}<br />
                    <strong>Details:</strong> {row[map['ardetails']]}<br />
                  </>
                )}
                {isSV && (
                  <>
                    <strong>Type:</strong> Scanning Violation | <strong>Customer:</strong> {row[map['svcustomername']]} | <strong>Amount:</strong> ${row[map['svfeeamount']]}<br />
                    <strong>Details:</strong> {row[map['svdetails']]}<br />
                  </>
                )}
              </li>
            );
          })}
        </ul>
      ) : (
        <p>No violations or ARs found for this period.</p>
      )}
    </div>
  );
};

export default Dashboard;
